318\\\" height=\\\"139\\\" srcset=\\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2019\\/01\\/gutenberg-vs-bb-notification.jpg 318w, https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2019\\/01\\/gutenberg-vs-bb-notification-300x131.jpg 300w\\\" sizes=\\\"(max-width: 318px) 100vw, 318px\\\" \\/><\\/p>\\n<p>This question has been coming up a lot! In this post, we explain how page builders differ from Gutenberg and the best scenarios to understand when to use one or the other. This might be old news to\\u00a0Beaver Builder users like you, but if you have a client or a friend that is trying to grok the differences this is the post for them.<\\/p>\\n\",\"protected\":false},\"template\":\"\",\"meta\":{\"_fl_notification\":[\"https:\\/\\/www.wpbeaverbuilder.com\\/difference-between-gutenberg-and-page-builders-like-beaver-builder-elementor-and-divi\\/\"],\"_links_to\":\"\",\"_links_to_target\":\"\"},\"_links\":{\"self\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\\/423877\"}],\"collection\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\"}],\"about\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/types\\/fl_notification\"}],\"wp:attachment\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/media?parent=423877\"}],\"curies\":[{\"name\":\"wp\",\"href\":\"https:\\/\\/api.w.org\\/{rel}\",\"templated\":true}]}},{\"id\":421774,\"date\":\"2019-01-09T10:34:00\",\"date_gmt\":\"2019-01-09T18:34:00\",\"guid\":{\"rendered\":\"https:\\/\\/www.wpbeaverbuilder.com\\/?post_type=fl_notification&#038;p=421774\"},\"modified\":\"2019-01-09T10:34:00\",\"modified_gmt\":\"2019-01-09T18:34:00\",\"slug\":\"mental-health-stress-and-burnout-an-interview-with-dr-sherry-walling\",\"status\":\"publish\",\"type\":\"fl_notification\",\"link\":\"https:\\/\\/www.wpbeaverbuilder.com\\/?fl_notification=mental-health-stress-and-burnout-an-interview-with-dr-sherry-walling\",\"title\":{\"rendered\":\"Mental Health, Stress, and Burnout \\u2013 An interview with Dr. Sherry Walling\"},\"content\":{\"rendered\":\"<p><img class=\\\"aligncenter size-full wp-image-421777\\\" src=\\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2019\\/01\\/sherry-walling-notification.jpg\\\" alt=\\\"Mental health, stress, and burnout\\\" width=\\\"318\\\" height=\\\"139\\\" srcset=\\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2019\\/01\\/sherry-walling-notification.jpg 318w, https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2019\\/01\\/sherry-walling-notification-300x131.jpg 300w\\\" sizes=\\\"(max-width: 318px) 100vw, 318px\\\" \\/><\\/p>\\n<p>We met Dr. Sherry Walling several years ago at an event and were extremely impressed with her candid discussions about mental health in the entrepreneurial space. I am thrilled that she agreed to work with us on an interview-style blog post discussing some practical ways to improve one\'s mental and emotional wellbeing.<\\/p>\\n\",\"protected\":false},\"template\":\"\",\"meta\":{\"_fl_notification\":[\"https:\\/\\/www.wpbeaverbuilder.com\\/mental-health-stress-and-burnout-an-interview-with-dr-sherry-walling\\/\"],\"_links_to\":\"\",\"_links_to_target\":\"\"},\"_links\":{\"self\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\\/421774\"}],\"collection\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\"}],\"about\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/types\\/fl_notification\"}],\"wp:attachment\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/media?parent=421774\"}],\"curies\":[{\"name\":\"wp\",\"href\":\"https:\\/\\/api.w.org\\/{rel}\",\"templated\":true}]}},{\"id\":416381,\"date\":\"2018-12-14T09:02:44\",\"date_gmt\":\"2018-12-14T17:02:44\",\"guid\":{\"rendered\":\"https:\\/\\/www.wpbeaverbuilder.com\\/?post_type=fl_notification&#038;p=416381\"},\"modified\":\"2018-12-14T09:02:44\",\"modified_gmt\":\"2018-12-14T17:02:44\",\"slug\":\"thoughts-on-gutenberg-and-a-wordcamp-us-recap\",\"status\":\"publish\",\"type\":\"fl_notification\",\"link\":\"https:\\/\\/www.wpbeaverbuilder.com\\/?fl_notification=thoughts-on-gutenberg-and-a-wordcamp-us-recap\",\"title\":{\"rendered\":\"Thoughts on Gutenberg and a WordCamp US Recap\"},\"content\":{\"rendered\":\"<p><img class=\\\"aligncenter size-full wp-image-416382\\\" src=\\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/12\\/wcus-notification.jpg\\\" alt=\\\"\\\" width=\\\"318\\\" height=\\\"139\\\" srcset=\\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/12\\/wcus-notification.jpg 318w, https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/12\\/wcus-notification-300x131.jpg 300w\\\" sizes=\\\"(max-width: 318px) 100vw, 318px\\\" \\/><\\/p>\\n<p>A few of us from the Beaver Builder team had the opportunity to attend WordCamp US 2018 in Nashville, Tennessee, this week. I\'d like to try something new this year and write down a few thoughts about the event and share photos.<\\/p>\\n\",\"protected\":false},\"template\":\"\",\"meta\":{\"_fl_notification\":[\"https:\\/\\/www.wpbeaverbuilder.com\\/thoughts-on-gutenberg-and-a-wordcamp-us-recap\\/\"],\"_links_to\":\"\",\"_links_to_target\":\"\"},\"_links\":{\"self\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\\/416381\"}],\"collection\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\"}],\"about\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/types\\/fl_notification\"}],\"wp:attachment\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/media?parent=416381\"}],\"curies\":[{\"name\":\"wp\",\"href\":\"https:\\/\\/api.w.org\\/{rel}\",\"templated\":true}]}},{\"id\":408945,\"date\":\"2018-11-23T15:19:24\",\"date_gmt\":\"2018-11-23T2