,\"templated\":true}]}},{\"id\":404849,\"date\":\"2018-11-08T13:34:29\",\"date_gmt\":\"2018-11-08T21:34:29\",\"guid\":{\"rendered\":\"https:\\/\\/www.wpbeaverbuilder.com\\/?post_type=fl_notification&#038;p=404849\"},\"modified\":\"2018-11-08T13:34:29\",\"modified_gmt\":\"2018-11-08T21:34:29\",\"slug\":\"autumn-update-addressing-all-the-elephants\",\"status\":\"publish\",\"type\":\"fl_notification\",\"link\":\"https:\\/\\/www.wpbeaverbuilder.com\\/?fl_notification=autumn-update-addressing-all-the-elephants\",\"title\":{\"rendered\":\"Autumn Update \\u2013 Addressing all the Elephants\"},\"content\":{\"rendered\":\"<p><img class=\\\"aligncenter size-full wp-image-404853\\\" src=\\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/11\\/autumn-update-notification.jpg\\\" alt=\\\"\\\" width=\\\"318\\\" height=\\\"139\\\" srcset=\\\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/11\\/autumn-update-notification.jpg 318w, https:\\/\\/www.wpbeaverbuilder.com\\/wp-content\\/uploads\\/2018\\/11\\/autumn-update-notification-300x131.jpg 300w\\\" sizes=\\\"(max-width: 318px) 100vw, 318px\\\" \\/><\\/p>\\n<p>Why, hello there! It\'s an exciting time in the WordPress world with Gutenberg on the verge of going live. We have a bunch of exciting news to share and new features to announce. Find out more in our Autumn update.<\\/p>\\n\",\"protected\":false},\"template\":\"\",\"meta\":{\"_fl_notification\":[\"https:\\/\\/www.wpbeaverbuilder.com\\/autumn-update-addressing-all-the-elephants\\/\"],\"_links_to\":\"\",\"_links_to_target\":\"\"},\"_links\":{\"self\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\\/404849\"}],\"collection\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/fl_notification\"}],\"about\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp\\/v2\\/types\\/fl_notification\"}],\"wp:attachment\":[{\"href\":\"https:\\/\\/www.wpbeaverbuilder.com\\/wp-json\\/wp